            <div className="text-right">
                <h1>340.</h1>
                <hr/>
                <ul>
                    <li></li>
                    <li></li>
                </ul>
                <hr/>
                <button className= "btn btn-block btn-danger title">ยืนยัน</button>
                <button className= "btn btn-block btn-secondary title">ยกเลิก</button>
                
            </div>
        )
    }
}
export default Calculator;
